<body>
    <div class="aoutbox">

            <div class="obv" id="observablehq-viewof-numRows-e7e5fcf7"></div>
            <div class="obv" id="observablehq-viewof-field1-e7e5fcf7"></div>
            <div class="obv" id="observablehq-viewof-field2-e7e5fcf7"></div>
            <div class="obv" id="observablehq-viewof-mark-e7e5fcf7"></div>
            <!-- <div id="observablehq-mark_inner-e7e5fcf7"></div> -->

            <div id="observablehq-embed-e7e5fcf7"></div> -->

            <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/@observablehq/inspector@5/dist/inspector.css">
            <script type="module">
                import {Runtime, Inspector} from "https://cdn.jsdelivr.net/npm/@observablehq/runtime@5/dist/runtime.js";
                import define from "https://api.observablehq.com/d/c46ba76a55f54991.js?v=3";
                new Runtime().module(define, name => {
                //   if (name === "superstore_dataset20112015") return new Inspector(document.querySelector("#observablehq-superstore_dataset20112015-e7e5fcf7"));
                //   if (name === "newdata") return new Inspector(document.querySelector("#observablehq-newdata-e7e5fcf7"));
                //   if (name === "saveJSON") return new Inspector(document.querySelector("#observablehq-saveJSON-e7e5fcf7"));
                //   if (name === "EXAMPLE") return new Inspector(document.querySelector("#observablehq-EXAMPLE-e7e5fcf7"));
                //   if (name === "result") return new Inspector(document.querySelector("#observablehq-result-e7e5fcf7"));
                //   if (name === "spec") return new Inspector(document.querySelector("#observablehq-spec-e7e5fcf7"));
                //   if (name === "specp") return new Inspector(document.querySelector("#observablehq-specp-e7e5fcf7"));
                if (name === "viewof numRows") return new Inspector(document.querySelector("#observablehq-viewof-numRows-e7e5fcf7"));
                if (name === "viewof field1") return new Inspector(document.querySelector("#observablehq-viewof-field1-e7e5fcf7"));
                if (name === "viewof field2") return new Inspector(document.querySelector("#observablehq-viewof-field2-e7e5fcf7"));
                if (name === "viewof mark") return new Inspector(document.querySelector("#observablehq-viewof-mark-e7e5fcf7"));
                //   if (name === "mark_inner") return new Inspector(document.querySelector("#observablehq-mark_inner-e7e5fcf7"));
                if (name === "viewof other") return new Inspector(document.querySelector("#observablehq-viewof-other-e7e5fcf7"));
                if (name === "svg") return new Inspector(document.querySelector("#observablehq-svg-e7e5fcf7"));
                //   if (name === "Draco") return new Inspector(document.querySelector("#observablehq-Draco-e7e5fcf7"));
                //   if (name === "draco") return new Inspector(document.querySelector("#observablehq-draco-e7e5fcf7"));
                //   if (name === "embed") return new Inspector(document.querySelector("#observablehq-embed-e7e5fcf7"));
                });
            </script>
        </div>
        <div class="bright">

            <div id="observablehq-svg-e7e5fcf7"></div>
